export default function line(props){
    const styles = {
        root: {
          border: "1px solid grey",
        },}

    return(
    <table>
    <tr style={styles.root}>
    <td style={styles.root}>{props.human.id}</td>
        <td>{props.human.firstName}</td>
        <td>{props.human.lastName}</td>
        <td>{props.human.email}</td>
        <td>{props.human.phone}</td>
    </tr>
</table>
);
}
